import React, { useState, useEffect, useRef } from 'react';
import { FiShoppingCart, FiSearch, FiMenu, FiX, FiUser } from 'react-icons/fi';
import { Link, useLocation } from 'react-router-dom';
import '../styles/main.css';
import '../styles/header.css';
import { useCart } from '../context/CartContext';

export default function Header() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const { cartCount, user, isAuthenticated } = useCart();
  const headerRef = useRef(null);
  const location = useLocation();

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);
  const closeMenu = () => setIsMenuOpen(false);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (headerRef.current && !headerRef.current.contains(event.target)) {
        closeMenu();
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  useEffect(() => {
    closeMenu();
  }, [location]);

  return (
    <header className="header" ref={headerRef}>
      <div className="header-container container">
        <button 
          className="mobile-menu-button" 
          onClick={toggleMenu}
          aria-label={isMenuOpen ? "Закрыть меню" : "Открыть меню"}
          aria-expanded={isMenuOpen}
        >
          {isMenuOpen ? <FiX size={24} /> : <FiMenu size={24} />}
        </button>

        <Link to="/" className="logo" onClick={closeMenu}>
          LI-NING
        </Link>
        
        <div className={`nav-content ${isMenuOpen ? 'active' : ''}`}>
          <nav className="nav-menu">
            <Link 
              to="/" 
              className={`nav-link ${location.pathname === '/' ? 'active' : ''}`} 
              onClick={closeMenu}
            >
              Главная
            </Link>
            <Link 
              to="/about" 
              className={`nav-link ${location.pathname === '/about' ? 'active' : ''}`} 
              onClick={closeMenu}
            >
              О нас
            </Link>
            <Link 
              to="/auth" 
              className={`nav-link ${location.pathname === '/auth' ? 'active' : ''}`} 
              onClick={closeMenu}
            >
              Вход
            </Link>
          </nav>

          <div className="search-cart-wrapper">
            <div className="search-container">
              <FiSearch className="search-icon" />
              <input
                type="text"
                placeholder="Поиск..."
                className="search-input"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            </div>

            <div className="header-actions">
              <Link 
              to="/cart" 
              className="cart-button" 
              onClick={closeMenu}
              aria-label="Корзина"
            >
              <FiShoppingCart size={20} />
              <span className="cart-text">Корзина</span>
              {cartCount > 0 && (
                <span className="cart-count">{cartCount}</span>
              )}
            </Link>
            
            <Link 
              to={isAuthenticated ? "/profile" : "/auth"} 
              className="profile-button"
              onClick={closeMenu}
              aria-label={isAuthenticated ? "Профиль" : "Войти"}
            >
              <FiUser size={20} />
              {isAuthenticated && user?.name && (
                <span className="user-name">{user.name.split(' ')[0]}</span>
              )}
            </Link>
          </div>
          </div>
        </div>
      </div>
    </header>
  );
}
